class Solution:
    def findAnagrams(self, s: str, p: str) -> list[int]:
        ns = len(s)
        np = len(p)
        p = sorted(p)
        result = list()
        sorts = {}
        for i in range(ns-np+1):
            tester = s[i:i+np]
            if tester not in sorts:
                sorts[tester] = sorted(s[i:i+np])
            if sorts[tester] == p:
                result.append(i)
        return result


s = Solution()
result = s.findAnagrams(
        ""
        ,"")
print(result)